INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 27, "A", "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", "ヒヨリ", 44, "獣人族", "東山奈央", 16, 155, "人助けが大好き！　前向き格闘娘", 2, 100101);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, 0, 5, "O", "トゥインクルウィッシュ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", "ユイ", 47, "ヒューマン", "種田梨沙", 17, 158, "戦闘のサポートが得意な、心優しい少女", 2, 100201);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, 0, 12, "B", "トゥインクルウィッシュ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "読書、乗馬、お茶", "レイ", 46, "魔族", "早見沙織", 18, 163, "クールで何事にも真っ直ぐな剣士", 2, 100301);
