INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 0, 22, "O", "悪魔偽王国軍（ディアボロス）", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "サックス", "アカリ", 42, "魔族", "浅倉杏美", 13, 150, "甘え上手なみんなの人気者", 7, 100601);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, 0, 23, "B", "悪魔偽王国軍（ディアボロス）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", "ミヤコ", 32, "魔族", "雨宮天", 14, 130, "プリン大好きゴースト娘", 7, 100701);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 0, 10, "AB", "ヴァイスフリューゲル　ランドソル支部", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "鏡で自分を見ること", "ユキ", 40, "エルフ", "大空直美", 14, 150, "ボクは誰よりも美しい", 15, 100801);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 0, 5, "A", "トワイライトキャラバン", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "小説執筆", "アンナ", 45, "魔族", "髙野麻美", 17, 159, "前世を信じる中二病患者、「疾風の冥姫」", 13, 100901);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 0, 22, "O", "自警団（カォン）", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "空想、ぬいぐるみ集め", "マホ", 42, "獣人族", "内田真礼", 16, 155, "マホマホ王国のプリンセス", 10, 101001);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 25, "A", "ラビリンス", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "お裁縫", "リノ", 44, "ヒューマン", "阿澄佳奈", 15, 156, "人懐っこくてマシンガントークな妹系少女", 3, 101101);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 0, 24, "A", "フォレスティエ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "妹と遊ぶこと、二度寝、昼寝、早寝", "ハツネ", 46, "エルフ", "大橋彩香", 17, 156, "みんなのために超能力を使う眠り姫", 6, 101201);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 21, "O", "トワイライトキャラバン", "", "読書、魔法", "ナナカ", 55, "魔族", "佳村はるか", 18, 166, "オタク全開な魔法少女", 13, 101301);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 0, 3, "AB", "自警団（カォン）", "test", "読書、推理", "カスミ", 41, "獣人族", "水瀬いのり", 15, 152, "頭脳明晰な美少女名探偵", 10, 101401);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 0, 5, "O", "フォレスティエ", "test", "絵本作り", "ミサト", 54, "エルフ", "國府田マリ子", 21, 165, "母性溢れる優しいみんなの「ミサト先生」", 6, 101501);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, 0, 10, "O", "ルーセント学院", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "ファッション", "スズナ", 48, "魔族", "上坂すみれ", 18, 167, "天真爛漫で人気者のカリスマモデル", 14, 101601);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 0, 7, "A", "自警団（カォン）", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "踊り、空手", "カオリ", 53, "獣人族", "高森奈津美", 19, 158, "いつでも「なんくるないさ～」な天然娘", 10, 101701);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 14, "B", "ルーセント学院", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "イオ", 52, "魔族", "伊藤静", 23, 162, "多くの男性を魅了する無垢な女教師", 14, 101801);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, 0, 3, "O", "リトルリリカル", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "かわいいもの集め", "ミミ", 21, "獣人族", "日高里菜", 10, 117, "お歌もにんじんも、ウサギさんも大好き♪", 5, 102001);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 0, 9, "B", "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", "クルミ", 40, "ヒューマン", "植田佳奈", 12, 150, "泣き虫で臆病な守ってあげたい女の子", 9, 102101);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 0, 22, "O", "悪魔偽王国軍（ディアボロス）", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ゲーム全般", "ヨリ", 40, "魔族", "原紗友里", 13, 150, "人見知りであまのじゃくな女の子", 7, 102201);
