INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 0, 12, "O", "サレンディア救護院", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ご奉仕", "スズメ", 43, "ヒューマン", "悠木碧", 15, 154, "お嬢さまのためにがんばるドジっ娘メイド", 9, 102501);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, 0, 1, "B", "牧場（エリザベスパーク）", "test", "あんパン", "リン", 42, "獣人族", "小岩井ことり", 17, 144, "遊びと睡眠が何より大事なぐうたら娘", 11, 102601);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 0, 30, "B", "トワイライトキャラバン", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "実験、裁縫、料理", "エリコ", 43, "魔族", "橋本ちなみ", 16, 154, "運命の相手に一途すぎる乙女", 13, 102701);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 0, 4, "A", "サレンディア救護院", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "経営、お茶会", "サレン", 43, "エルフ", "堀江由衣", 17, 156, "救護院を経営する優しい庶民派お嬢様", 9, 102801);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, 0, 24, "B", "カルミナ", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "舞台鑑賞、ダンス", "ノゾミ", 40, "ヒューマン", "日笠陽子", 17, 157, "歌って踊れる大人気アイドル", 4, 102901);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 31, "O", "ヴァイスフリューゲル　ランドソル支部", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "忍法開発", "ニノン", 51, "ヒューマン", "佐藤聡美", 16, 163, "トーゴクの神秘、オシエテクダサイ！", 15, 103001);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 0, 22, "AB", "悪魔偽王国軍（ディアボロス）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", "シノブ", 42, "魔族", "大坪由佳", 18, 157, "占いが得意な霊能少女", 7, 103101);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, 0, 12, "AB", "メルクリウス財団", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "慈善事業", "アキノ", 45, "ヒューマン", "松嵜麗", 18, 157, "一人前の商人を目指すパワフルお嬢様", 12, 103201);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, 0, 3, "B", "牧場（エリザベスパーク）", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "漫才", "マヒル", 35, "ヒューマン", "新田恵海", 20, 142, "みんなを笑顔にするお笑い牧場主", 11, 103301);
