INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (2, 0, 2, "A", "リトルリリカル", "test", "お勉強", "キョウカ", 21, "エルフ", "小倉唯", 8, 118, "礼儀正しくしっかり者のちびっ子優等生", 5, 103601);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 11, "A", "王宮騎士団（NIGHTMARE）", "test", "剣術、年長者をからかう", "トモ", 43, "ヒューマン", "茅原実里", 13, 149, "義理堅くてからかい好きな剣術少女", 8, 103701);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 0, 3, "A", "牧場（エリザベスパーク）", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "読書、お散歩", "シオリ", 40, "獣人族", "小清水亜美", 14, 153, "読書が趣味の病弱少女", 11, 103801);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 0, 6, "AB", "フォレスティエ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "友達作りのイメトレ", "アオイ", 44, "エルフ", "花澤香菜", 13, 158, "「友達」に憧れる、エルフの森の女の子", 6, 104001);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 0, 3, "O", "カルミナ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", "チカ", 46, "ヒューマン", "福原綾香", 17, 163, "人々を守るために歌う、唱喚士の少女", 4, 104201);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 9, "O", "自警団（カォン）", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "お菓子作り", "マコト", 54, "獣人族", "小松未可子", 17, 168, "男勝りで情に厚いワイルド娘", 10, 104301);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, 0, 5, "A", "悪魔偽王国軍（ディアボロス）", "test", "世界征服", "イリヤ", 50, "魔族", "丹下桜", "??", 172, "かつては夜を支配した最強の吸血鬼", 7, 104401);
