INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, 0, 1, "AB", "メルクリウス財団", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "猫とたわむれること", "タマキ", 48, "獣人族", "沼倉愛美", 18, 158, "弱きを助け強きをくじく猫娘", 12, 104601);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 0, 25, "A", "王宮騎士団（NIGHTMARE）", "？？？", "格闘技、湯浴み", "ジュン", 50, "ヒューマン", "川澄綾子", 25, 171, "素顔を見せない冷静沈着な女性騎士", 8, 104701);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 0, 11, "O", "メルクリウス財団", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", "ミフユ", 49, "ヒューマン", "田所あずさ", 20, 163, "仕事も私事も効率優先な傭兵少女", 12, 104801);
