INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 0, 22, "AB", "悪魔偽王国軍（ディアボロス）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", "シノブ（ハロウィン）", 42, "魔族", "大坪由佳", 18, 157, "占いが得意な霊能少女", 7, 108101);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, 0, 23, "B", "悪魔偽王国軍（ディアボロス）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", "ミヤコ（ハロウィン）", 32, "魔族", "雨宮天", 14, 130, "プリン大好きゴースト娘", 7, 108201);
