INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 0, 3, "O", "カルミナ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", "チカ（クリスマス）", 46, "ヒューマン", "福原綾香", 17, 163, "人々を守るために歌う、唱喚士の少女", 4, 108401);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 0, 9, "B", "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", "クルミ（クリスマス）", 40, "ヒューマン", "植田佳奈", 12, 150, "泣き虫で臆病な守ってあげたい女の子", 9, 108501);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, 0, 10, "B", "サレンディア救護院", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "屋内でできる遊び", "アヤネ（クリスマス）", 38, "ヒューマン", "芹澤優", 14, 148, "ぷうきちといつも一緒！", 9, 108601);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 0, 27, "A", "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", "ヒヨリ（ニューイヤー）", 44, "獣人族", "東山奈央", 16, 155, "人助けが大好き！　前向き格闘娘", 2, 108701);
